icrophone and Projector (OR will there be any open or private area that we can conduct a small \r\nscale meeting without any additional charges.)\r\n7)	To rent a bus to pick up from Taman Gembira to Ritz Garden Hotel on 29th Jul 2018 and Ritz Garden Hotel to Taman Gembira, KL on 31st Jul 2018.\r\n','1985','129'),(7,'Linda','Bailey','Internet Marketing','Marketing','206-309-5272','206-309-5272','Linda.Bailey085@gmail.com','1225 Wilshire Boulevard','Los Angeles','81611','','Want more clients and customers ?','Hi\r\nWe can help your website to get on first page of Google and increase the number of leads and sales you are getting from your website.\r\n\r\nPlease email us back for full proposal.\r\n\r\nBest Regards\r\nLinda','3624','223'),(8,'Evon','Ng','BM COATING & CHEMICAL SDN BHD ','ADMIN CLERK','0391348822','03-9134 7788','info@bmcoating.com','Wisma BM Group , NO.16,16-1 & 16-2 , JALAN MANIS 1 ,\r\nTAMAN SEGAR , 56100 CHERAS , KUALA LUMPUR','WILAYAH PERSEKUTUAN','56100','','MALAYSIA\'S LARGEST ONE STOP COATING FOR HOTEL & SERVICE RESIDENCES','Dear Sir / Madam ,\r\n\r\nWe are the supplier of coating industries.\r\n\r\nUser / Project Reference In Malaysia :  \r\nAscott Hotel , Holiday Inn Glenmarie Kuala Lumpur , Hotel Hilton PJ , Furama Hotel Kuala Lumpur , Mahkota Melaka , Royale Bintang Damansara , Seri Pacific Hotel Kuala Lumpur , Hotel Equatorial Melaka , Astro , Putrajaya , TNB , Menara Maxis , Menara Celcom , Genting Highlands , Sime Darby , Alliance Bank , Hard Rock Hotel Penang & Etc.\r\n\r\nPlease log into our website of www.bmcoating.com for more information details.','1985','129'),(9,'Nelson','Tan','PMG Asia Pacific Pte Ltd','Project Manager','+6596373151','','nelson.tan@pmgasia.com','71 Neil Road','Singapore','088900','','Request quote','Hi Person - in - charge,\r\n \r\nI would like to have a quotation for my oncoming event on 31 Oct 2018\r\nhotel for 18 pax\r\ncheck-in date: 31 Oct 2-2018\r\ncheck-out date: 1 Nov 2018','','188'),(10,'Glen Hilyard','Glen 