INSERT INTO `pages` VALUES (1,'about','','a:22:{s:9:\"icon-img1\";s:12:\"icon-compass\";s:9:\"icon-img2\";s:8:\"icon-eur\";s:5:\"title\";s:144:\"<div id=\"page-header\"><h1>About Us</h1><p><br></p><h2>Improve people\'s lifestyle by providing high class retail experience</h2><p><br></p></div>\";s:10:\"info-title\";s:24:\"<h2>Message From MD</h2>\";s:9:\"info-name\";s:43:\"<p>Mr. Tan Long Kee / Managing Director</p>\";s:16:\"info-description\";s:1075:\"<p>When my late father Mr Tan Boon Ming founded TBM in 1945, he has always been committed to providing genuine and sincere customer service in all aspects of the business. Over the years, without losing sight of his commitment, our wonderful team of dedicated people has weaved TBM into the colourful fabric of Klang valley by always providing for the most current lifestyle trends. Today, we are very proud to be carrying over 30 well-known brands of consumer electronics and home electrical appliances. Meanwhile, we are still looking forward to expand our range of products and services to enhance our customers\' way of life.</p><p>In the face of a rapidly developing world, our next challenge is to innovate the way we improve our customer\'s lifestyle. It is our aim to create a unique and distinguished retail experience to our customers. We would like to thank everybody – customers, suppliers and staff, who have supported us over the years. We will strive hard to continue in developing a dynamic and sustainable relationship with all of TBM\'s stakeholders. rrr</p>\";s:16:\"first-icon-title\";s:15:\"<h3>Vision</h3>\";s:22:\"first-icon-description\";s:114:\"<blockquote><p><em>To develop Area Top Shops with the best shopping and working environment.</em></p></blockquote>\";s:17:\"second-icon-title\";s:16:\"<h3>Mission</h3>\";s:23:\"second-icon-description\";s:159:\"<blockquote><p><em>To improve people\'s lifestyle by providing high class retail experience through well-trained and innovative employees.</em></p></blockquote>\";s:14:\"content-title1\";s:18:\"<h2>Our Story</h2>\";s:18:\"content-signature1\";s:32:\"<p>We started in a small way</p>\";s:13:\"content-text1\";s:584:\"<p>Tan Boon Ming started a business in 1945, before he got married and just after World War II. It was a small shop dealing in bicycles. He registered Syarikat Tan Boon Ming only in 1953 because then very few people registered their businesses.</p><p>The company also ventured into sewing machines, furnitures & radios. Later, it switched to electrical items to follow lifestyle changes. Business began to grow from the support of loyal customers. By the mid 1970s it moved into the present premises. Trading under the new name of Tan Boon Ming Sdn. Bhd. began on January 1, 2000.</p>\";s:14:\"content-title2\";s:30:\"<h3>Our Business Strategy</h3>\";s:18:\"content-signature2\";s:69:\"<p>Work very hard, smile often and give something extra if we can</p>\";s:13:\"content-text2\";s:242:\"<p>Our strategy then was simple - work very hard, smile often and give something extra if we can. Today our strategy remains the same except that we are now trying to be more colourful, by using a logo, to make us even easier to remember.</p>\";s:14:\"content-title3\";s:39:\"<h3>How to Choose Our Logo Concept</h3>\";s:18:\"content-signature3\";s:84:\"<p>What was important to us was how to provide reliable service to our customers</p>\";s:13:\"content-text3\";s:1285:\"<p>Should we be identified with our industry? Should we portray our global potential?</p><p>It was very difficult. What was important to us was how to provide reliable service to our customers. How to price the products affordably and yet remain profitable enough to pay staffs & contractors fairly, so that they too could have a decent living whilst we could still grow bigger.</p><p>We wanted a logo that was able to capture these sentiments.</p><p>How the final design was selected We were given designs that carried \"industry\" themes & depicted class. We toyed with bright colours like yellow. We tried the bluish greenish millennium colours. In the end we picked the simple red & blue.</p><p>They happened to be the company\'s existing colours - retaining it meant continuity. They were common, everyday colours - it signified acceptability. They have survived decades in time - it represents longevity. And of course the richness of blue and the warmness of red also spelt hope & prosperity.</p><p>We told the Artist to get out of the industry - to capture courtesy & service in the logo. The final product was the accidental result of creative design - TBM in a graphic smile, complete with a dimple... the dot to also signify our world up there - happy, dancing and smiling.</p>\";s:14:\"content-title4\";s:30:\"<h3>Responses to the Logo</h3>\";s:18:\"content-signature4\";s:84:\"<p>What was important to us was how to provide reliable service to our customers</p>\";s:13:\"content-text4\";s:1434:\"<p>It was strongly rejected for being too abstract - but in it the group\'s Advisor saw the smile of Tan Long Kee, the group\'s Managing Director - the quiet smile of a gentleman. She could also see the smile developing into the full hearted laughter of Tan Long Han, the Managing Director of the Service Centre - the laugh of a sincere man.</p><p>It was also the smile of our satisfied customers. The smile of our happy staffs. And the smile of our faithful contractors. It was the smile of our friends, our family and all the people around us.</p><p>We asked the Artist to improve on the TBM smile. Then we presented it at the general assembly. From Chinese to Malay to English speaking, from the Store department to the Outdoor to the Sales, the MIS and the Service departments - the TBM smile was well received.</p><p>Staffs said it was \"a happy smile\", \"it showed no rank in the company\", \"it showed maju & meningkat\". It was simple & nice.., from small to big.., the list went on. It was the people\'s smile! They could recognise it!</p><p>The entire assembly voted for the TBM smile. After the assembly, we selected four more staffs for another special session. From MIS, one very young staff commented \"globalisation is very distant, a smile brings us closer together\".</p><p>So that Friday April 28, 2000, we found our logo!</p><p>We thank God for the many good years past & present and for the many more good years to come.</p>\";}','a:22:{s:9:\"icon-img1\";s:12:\"icon-compass\";s:9:\"icon-img2\";s:8:\"icon-eur\";s:5:\"title\";s:144:\"<div id=\"page-header\"><h1>About Us</h1><p><br></p><h2>Improve people\'s lifestyle by providing high class retail experience</h2><p><br></p></div>\";s:10:\"info-title\";s:24:\"<h2>Message From MD</h2>\";s:9:\"info-name\";s:43:\"<p>Mr. Tan Long Kee / Managing Director</p>\";s:16:\"info-description\";s:1075:\"<p>When my late father Mr Tan Boon Ming founded TBM in 1945, he has always been committed to providing genuine and sincere customer service in all aspects of the business. Over the years, without losing sight of his commitment, our wonderful team of dedicated people has weaved TBM into the colourful fabric of Klang valley by always providing for the most current lifestyle trends. Today, we are very proud to be carrying over 30 well-known brands of consumer electronics and home electrical appliances. Meanwhile, we are still looking forward to expand our range of products and services to enhance our customers\' way of life.</p><p>In the face of a rapidly developing world, our next challenge is to innovate the way we improve our customer\'s lifestyle. It is our aim to create a unique and distinguished retail experience to our customers. We would like to thank everybody – customers, suppliers and staff, who have supported us over the years. We will strive hard to continue in developing a dynamic and sustainable relationship with all of TBM\'s stakeholders. rrr</p>\";s:16:\"first-icon-title\";s:15:\"<h3>Vision</h3>\";s:22:\"first-icon-description\";s:114:\"<blockquote><p><em>To develop Area Top Shops with the best shopping and working environment.</em></p></blockquote>\";s:17:\"second-icon-title\";s:16:\"<h3>Mission</h3>\";s:23:\"second-icon-description\";s:159:\"<blockquote><p><em>To improve people\'s lifestyle by providing high class retail experience through well-trained and innovative employees.</em></p></blockquote>\";s:14:\"content-title1\";s:18:\"<h2>Our Story</h2>\";s:18:\"content-signature1\";s:32:\"<p>We started in a small way</p>\";s:13:\"content-text1\";s:584:\"<p>Tan Boon Ming started a business in 1945, before he got married and just after World War II. It was a small shop dealing in bicycles. He registered Syarikat Tan Boon Ming only in 1953 because then very few people registered their businesses.</p><p>The company also ventured into sewing machines, furnitures & radios. Later, it switched to electrical items to follow lifestyle changes. Business began to grow from the support of loyal customers. By the mid 1970s it moved into the present premises. Trading under the new name of Tan Boon Ming Sdn. Bhd. began on January 1, 2000.</p>\";s:14:\"content-title2\";s:30:\"<h3>Our Business Strategy</h3>\";s:18:\"content-signature2\";s:69:\"<p>Work very hard, smile often and give something extra if we can</p>\";s:13:\"content-text2\";s:242:\"<p>Our strategy then was simple - work very hard, smile often and give something extra if we can. Today our strategy remains the same except that we are now trying to be more colourful, by using a logo, to make us even easier to remember.</p>\";s:14:\"content-title3\";s:39:\"<h3>How to Choose Our Logo Concept</h3>\";s:18:\"content-signature3\";s:84:\"<p>What was important to us was how to provide reliable service to our customers</p>\";s:13:\"content-text3\";s:1285:\"<p>Should we be identified with our industry? Should we portray our global potential?</p><p>It was very difficult. What was important to us was how to provide reliable service to our customers. How to price the products affordably and yet remain profitable enough to pay staffs & contractors fairly, so that they too could have a decent living whilst we could still grow bigger.</p><p>We wanted a logo that was able to capture these sentiments.</p><p>How the final design was selected We were given designs that carried \"industry\" themes & depicted class. We toyed with bright colours like yellow. We tried the bluish greenish millennium colours. In the end we picked the simple red & blue.</p><p>They happened to be the company\'s existing colours - retaining it meant continuity. They were common, everyday colours - it signified acceptability. They have survived decades in time - it represents longevity. And of course the richness of blue and the warmness of red also spelt hope & prosperity.</p><p>We told the Artist to get out of the industry - to capture courtesy & service in the logo. The final product was the accidental result of creative design - TBM in a graphic smile, complete with a dimple... the dot to also signify our world up there - happy, dancing and smiling.</p>\";s:14:\"content-title4\";s:30:\"<h3>Responses to the Logo</h3>\";s:18:\"content-signature4\";s:84:\"<p>What was important to us was how to provide reliable service to our customers</p>\";s:13:\"content-text4\";s:1434:\"<p>It was strongly rejected for being too abstract - but in it the group\'s Advisor saw the smile of Tan Long Kee, the group\'s Managing Director - the quiet smile of a gentleman. She could also see the smile developing into the full hearted laughter of Tan Long Han, the Managing Director of the Service Centre - the laugh of a sincere man.</p><p>It was also the smile of our satisfied customers. The smile of our happy staffs. And the smile of our faithful contractors. It was the smile of our friends, our family and all the people around us.</p><p>We asked the Artist to improve on the TBM smile. Then we presented it at the general assembly. From Chinese to Malay to English speaking, from the Store department to the Outdoor to the Sales, the MIS and the Service departments - the TBM smile was well received.</p><p>Staffs said it was \"a happy smile\", \"it showed no rank in the company\", \"it showed maju & meningkat\". It was simple & nice.., from small to big.., the list went on. It was the people\'s smile! They could recognise it!</p><p>The entire assembly voted for the TBM smile. After the assembly, we selected four more staffs for another special session. From MIS, one very young staff commented \"globalisation is very distant, a smile brings us closer together\".</p><p>So that Friday April 28, 2000, we found our logo!</p><p>We thank God for the many good years past & present and for the many more good years to come.</p>\";}','a:22:{s:9:\"icon-img1\";s:12:\"icon-compass\";s:9:\"icon-img2\";s:8:\"icon-eur\";s:5:\"title\";s:144:\"<div id=\"page-header\"><h1>About Us</h1><p><br></p><h2>Improve people\'s lifestyle by providing high class retail experience</h2><p><br></p></div>\";s:10:\"info-title\";s:24:\"<h2>Message From MD</h2>\";s:9:\"info-name\";s:43:\"<p>Mr. Tan Long Kee / Managing Director</p>\";s:16:\"info-description\";s:1075:\"<p>When my late father Mr Tan Boon Ming founded TBM in 1945, he has always been committed to providing genuine and sincere customer service in all aspects of the business. Over the years, without losing sight of his commitment, our wonderful team of dedicated people has weaved TBM into the colourful fabric of Klang valley by always providing for the most current lifestyle trends. Today, we are very proud to be carrying over 30 well-known brands of consumer electronics and home electrical appliances. Meanwhile, we are still looking forward to expand our range of products and services to enhance our customers\' way of life.</p><p>In the face of a rapidly developing world, our next challenge is to innovate the way we improve our customer\'s lifestyle. It is our aim to create a unique and distinguished retail experience to our customers. We would like to thank everybody – 