vide reliable service to our customers</p>\";s:13:\"content-text3\";s:1285:\"<p>Should we be identified with our industry? Should we portray our global potential?</p><p>It was very difficult. What was important to us was how to provide reliable service to our customers. How to price the products affordably and yet remain profitable enough to pay staffs & contractors fairly, so that they too could have a decent living whilst we could still grow bigger.</p><p>We wanted a logo that was able to capture these sentiments.</p><p>How the final design was selected We were given designs that carried \"industry\" themes & depicted class. We toyed with bright colours like yellow. We tried the bluish greenish millennium colours. In the end we picked the simple red & blue.</p><p>They happened to be the company\'s existing colours - retaining it meant continuity. They were common, everyday colours - it signified acceptability. They have survived decades in time - it represents longevity. And of course the richness of blue and the warmness of red also spelt hope & prosperity.</p><p>We told the Artist to get out of the industry - to capture courtesy & service in the logo. The final product was the accidental result of creative design - TBM in a graphic smile, complete with a dimple... the dot to also signify our world up there - happy, dancing and smiling.</p>\";s:14:\"content-title4\";s:30:\"<h3>Responses to the Logo</h3>\";s:18:\"content-signature4\";s:84:\"<p>What was important to us was how to provide reliable service to our customers</p>\";s:13:\"content-text4\";s:1434:\"<p>It was strongly rejected for being too abstract - but in it the group\'s Advisor saw the smile of Tan Long Kee, the group\'s Managing Director - the quiet smile of a gentleman. She could also see the smile developing into the full hearted laughter of Tan Long Han, the Managing Director of the Service Centre - the laugh of a sincere man.</p><p>It was also the smile of our satisfied customers. The smile of our happy staffs. And the smile of our faithful contractors. It was the smile of our friends, our family and all the people around us.</p><p>We asked the Artist to improve on the TBM smile. Then we presented it at the general assembly. From Chinese to Malay to English speaking, from the Store department to the Outdoor to the Sales, the MIS and the Service departments - the TBM smile was well received.</p><p>Staffs said it was \"a happy smile\", \"it showed no rank in the company\", \"it showed maju & meningkat\". It was simple & nice.., from small to big.., the list went on. It was the people\'s smile! They could recognise it!</p><p>The entire assembly voted for the TBM smile. After the assembly, we selected four more staffs for another special session. From MIS, one very young staff commented \"globalisation is very distant, a smile brings us closer together\".</p><p>So that Friday April 28, 2000, we found our logo!</p><p>We thank God for the many good years past & present and for the many more good years to come.</p>\";}','a:3:{i:0;a:2:{s:6:\"active\";i:1;s:5:\"title\";s:84:\"To develop the passion and devotion of employees to the well-being of all customers.\";}i:1;a:2:{s:6:\"active\";i:1;s:5:\"title\";s:77:\"To build long-term relationship with all stakeholders for sustainable growth.\";}i:2;a:2:{s:6:\"active\";i:1;s:5:\"title\";s:60:\"To remove borders for the higher efficiency and achievement.\";}}','a:3:{s:6:\"active\";i:1;s:5:\"title\";s:6:\"Bg-img\";s:5:\"image\";s:18:\"testimonialsbg.jpg\";}','2015-04-24 10:21:33','2015-12-10 17:54:44'),(3,'contact','','a:7:{s:6:\"header\";s:23:\"<h2>Contact Us<br></h2>\";s:5:\"title\";s:55:\"<p>Your friendly neighbourhood electrical store<br></p>\";s:4:\"lone\";s:356:\"<h3>Tan Boon Ming Sdn Bhd (494355-D)</h3><p>PS 4, 5, 6 & 7, Taman Evergreen, Batu 4, Jalan Klang Lama, 58100 Kuala Lumpur.</p><ul><li>Tel: (603) 7983-2020 (Hunting Lines)</li><li>Fax: (603) 7982-8141</li><li>GPS: 3.097098, 101.675505</li><li>Email: <a data-cke